{{Infobox TV channel| name= Disney Channel Serbia| | logofile = Disney Channel wordmark.svg | logosize = 200px logocaption= | owner= [[Disney-ABC Television Group]]| country= [[Serbia]]| language=[[English language|English]] / [[Serbian language|Serbian]]| broadcast area= Serbia| }}
'''Disney Channel Serbia''' is children's channel broadcasting to people in Serbia in English and is the Pan-European version of Disney Channel. Selected content is also available on other channels such as Wizards of Waverly Place on [[RTS1]].
==Programs aired on Disney Channel Serbia== * [[Hannah Montana]] * [[JONAS]] * [[Kim Possible]] * [[Phineas and Ferb]] * [[The Suite Life of Zack and Cody]] * [[Wizards of Waverly Place]] * [[Sonny With a Chance]] * [[Good Luck Charlie]] * [[Fish Hooks]] * [[Shake It Up (TV series)|Shake It Up]] * [[The Suite Life on Deck]] * [[Jake & Blake]] * [[The Replacements (TV series)]] * [[The Fairly OddParents]] * [[[[My Babysitter's a Vampire (TV series)|My Babysitter`s a vampire]]]]
